Meh, me too. Maybe a security measure because the file is executable?

Anyway, here's the code:
```js
#!/usr/bin/gjs -m

import Gdk from 'gi://Gdk?version=3.0';
import GObject from 'gi://GObject';
import Gtk from 'gi://Gtk?version=3.0';

import {programInvocationName, programArgs} from 'system';

class App extends Gtk.Application {
    static {
        GObject.registerClass(this);
    }

    constructor() {
        super({
            application_id: 'org.gnome.fmuellner.UrgencyTest',
        });
    }

    vfunc_activate() {
        const window = new Gtk.ApplicationWindow({
            application: this,
            title: 'Test Urgency',
        });
        window.present();

        setTimeout(() => window.set_urgency_hint(true), 1000);
    }
}

Gdk.set_allowed_backends('x11');
new App().run([programInvocationName, ...programArgs]);
```

> $ dpkg -s gnome-shell-extension-system-monitor | grep Version Version: 40-5

Is that correct? The system-monitor extension was only added in 46.0, so something looks off.

In any case this looks more like a libgtop issue. We simply use `get_netlist()` to get a list of interfaces, then call `get_netload()` on each returned name:

```
const netlist = new GTop.glibtop_netlist();
const ifnames = GTop.glibtop_get_netlist(netlist);

for (const ifname of ifnames) {
    const netload = new GTop.glibtop_netload();
    GTop.glibtop_get_netload(netload, ifname);
}
```

Expecting callers to use some external checks to validate the netlist return value kindof defeats the point of a library that abstracts these things.

(It could also be a kernel issue that /proc/net/dev contains interfaces without a corresponding entry in /sys/class/net)

