The backtrace points to [this code](https://gitlab.gnome.org/GNOME/gnome-shell/-/blob/gnome-46/js/ui/main.js#L607) in gnome-shell:

```js
    if (previousTheme) {
        let customStylesheets = previousTheme.get_custom_stylesheets();

        for (let i = 0; i < customStylesheets.length; i++)
            theme.load_stylesheet(customStylesheets[i]);
    }
```

What this code does is transferring "custom" (read: extension) stylesheets from the previous theme to the newly selected theme. But extension stylesheets should always come from some extension folder (like `~/.local/share/gnome-shell/extensions`), not `/tmp`.

I wonder whether there's some extension that messes around with stylesheets. What other extensions are you using?
